import React from "react";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="h-screen w-[250px] bg-yellow text-black">
      <div className="h-[20%]">
        <h1 className="text-white text-5xl">ScoreInfo</h1>
      </div>
      <div className="h-[80%]">
        <li className="block flex justify-center mt-5 text-2xl bg-white shadow-lg hover:bg-yellow hover:text-white">
          <NavLink to="/leagues">LEAGUES</NavLink>
        </li>
        <li className="block flex justify-center mt-3 text-2xl bg-white shadow-lg hover:bg-yellow hover:text-white">
          <NavLink to="/transfers">TRANSFERS</NavLink>
        </li>
        <li className="block flex justify-center mt-3 text-2xl bg-white shadow-lg hover:bg-yellow hover:text-white">
          <NavLink to="/players">PLAYERS</NavLink>
        </li>{" "}
      </div>
    </div>
  );
};

export default Navbar;
